import React from 'react'
import './App.css';
import {Switch, Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path={"/"} exact component={PokemonList} />
        <Route path={"/pokemon/:pokemon"} exact component={PokemonList} />
      </Switch>
    </div>
  );
}

export default App;
